import { Route } from 'react-router-dom';
import { Routes } from 'react-router-dom';
import './App.css';
import About from './Components/About';
import Test from './Components/Test';


function App() {
  return (
    <div className="App">


      <Routes>
        <Route path='/' element={<About/>}  ></Route>
        <Route path='/test' element={<Test/>}  ></Route>
      </Routes>

    </div>
  );
}

export default App;
